import React from "react";
import "./before.css";

const Before = (props) => {
  return (
    <div className="card text-center justify-content-center">
      <div className="overflow">
        <img src={props.imgsrc} alt="" className="card-img-top" />
      </div>

    </div>
  );
};

export default Before;
